CREATE DATABASE project;


create table project
(
    ID           int auto_increment
        primary key,
    PNAME        varchar(255)                       not null,
    TAGLINE      varchar(1000)                      null,
    TECHNOLOGIES varchar(255)                       null,
    OWNER        varchar(100)                       not null,
    TIMESTAMP    datetime default CURRENT_TIMESTAMP not null,
    COVERIMAGE   longblob                           null,
    INTRODUCTION varchar(5000)                      null,
    UPDATETIME   datetime default CURRENT_TIMESTAMP not null on update CURRENT_TIMESTAMP
)
    charset = utf8mb3;



create table project_comment
(
    PID     int                                not null,
    COMMENT text                               null,
    UID     varchar(150)                       null,
    TIME    datetime default CURRENT_TIMESTAMP null,
    CID     int auto_increment
        primary key,
    UNAME   varchar(100)                       null
);

create table project_like
(
    PID        int                  not null,
    UID        varchar(150)         null,
    LIKEAMOUNT tinyint(1) default 1 not null,
    UNAME      varchar(100)         null
);

create table project_photo
(
    PID        int                                not null,
    PHOTOID    int                                not null
        primary key,
    PHOTO      longblob                           null,
    UPLOADTIME datetime default CURRENT_TIMESTAMP null
);

create table project_skill
(
    PID    int         not null,
    SKILLS varchar(20) null
);

create table teacher_award
(
    UID            varchar(100)         not null,
    TEACHERCOMMENT text                 null,
    AWARD          tinyint(1) default 1 not null,
    PID            int                  not null,
    TEACHERNAME    varchar(100)         null
);

create table user
(
    ID           varchar(100) not null
        primary key,
    USERNAME     varchar(50)  not null,
    PASSWORD     varchar(50)  not null,
    EMAIL        varchar(100) not null,
    COOKIE       varchar(100) null,
    AUTHORITY    varchar(20)  not null,
    IMG          longblob     not null,
    INTRODUCTION mediumtext   null,
    SKILL        varchar(500) null,
    INTEREST     varchar(500) null
)
    charset = utf8mb3;

create index ID
    on user (ID);


